(1, 'aboutus', 'About Us', '<div>Tip74 is a fun and challenging site for everyone. As very keen sportsmen and sports fans we have created an amazing site to get everyone more involved in their favourite sports worldwide.</div>\n<div>&nbsp;</div>\n<div>We are starting off with the top 5 European football (soccer) leagues and the Mauritius Horse Racing, with many other leading sports to come soon. Every week members submit their own predictions (tips) for each week and the winner is selected by who has accumulated the most points. The points tally is shown with the rules and you have easy to follow instructions. Make sure you don&rsquo;t forget to use your double ups wisely each week to boost your points. The leading points scorer each week wins cash prizes, there is a cash prize to be won each and every week of all sports. You can submit as many entries as you wish each week.</div>\n<div>&nbsp;</div>'),
(2, 'contactus', 'Contact Us', '<p>Send an email from your private account to -</p>\n<p>&nbsp;</p>\n<p>support@tip74.com</p>'),
(4, 'privacypolicy', 'Privacy Policy', '<div>\n<p>1.&nbsp;Introduction</p>\n<p>Welcome to&nbsp;wintips ltd.</p>\n<p>wintips ltd&nbsp;(&ldquo;us&rdquo;, &ldquo;we&rdquo;, or &ldquo;our&rdquo;) operates&nbsp;<a href="http://tip74.com" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=http://tip74.com&amp;source=gmail&amp;ust=1603006546799000&amp;usg=AFQjCNEw7SvNhhl9Hs0SOgkRCfLWbFgWzg">tip74.com</a>&nbsp;(<wbr />hereinafter referred to as&nbsp;&ldquo;Service&rdquo;).</p>\n<p>Our Privacy Policy governs your visit to&nbsp;<a href="http://tip74.com" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=http://tip74.com&amp;source=gmail&amp;ust=1603006546799000&amp;usg=AFQjCNEw7SvNhhl9Hs0SOgkRCfLWbFgWzg">tip74.com</a>, and explains how we collect, safeguard and disclose information that results from your use of our Service.</p>\n<p>We use your data to provide and improve Service. By using Service, you agree to the collection and use of information in accordance with this policy. Unless otherwise defined in this Privacy Policy, the terms used in this Privacy Policy have the same meanings as in our Terms and Conditions.</p>\n<p>Our Terms and Conditions (&ldquo;Terms&rdquo;) govern all use of our Service and together with the Privacy Policy constitutes your agreement with us (&ldquo;agreement&rdquo;).</p>\n<p>2.&nbsp;Definitions</p>\n<p>SERVICE&nbsp;means the&nbsp;<a href="http://tip74.com" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=http://tip74.com&amp;source=gmail&amp;ust=1603006546799000&amp;usg=AFQjCNEw7SvNhhl9Hs0SOgkRCfLWbFgWzg">tip74.com</a>&nbsp;website operated by&nbsp;wintips ltd.</p>\n<p>PERSONAL DATA&nbsp;means data about a living individual who can be identified from those data (or from those and other information either in our possession or likely to come into our possession).</p>\n<p>USAGE DATA&nbsp;is data collected automatically either generated by the use of Service or from Service infrastructure itself (for example, the duration of a page visit).</p>\n<p>COOKIES&nbsp;are small files stored on your device (computer or mobile device).</p>\n<p>DATA CONTROLLER&nbsp;means a natural or legal person who (either alone or jointly or in common with other persons) determines the purposes for which and the manner in which any personal data are, or are to be, processed. For the purpose of this Privacy Policy, we are a Data Controller of your data.</p>\n<p>DATA PROCESSORS (OR SERVICE PROVIDERS)&nbsp;means any natural or legal person who processes the data on behalf of the Data Controller. We may use the services of various Service Providers in order to process your data more effectively.</p>\n<p>DATA SUBJECT&nbsp;is any living individual who is the subject of Personal Data.</p>\n<p>THE USER&nbsp;is the individual using our Service. The User corresponds to the Data Subject, who is the subject of Personal Data.</p>\n<p>3.&nbsp;Information Collection and Use</p>\n<p>We collect several different types of information for various purposes to provide and improve our Service to you.</p>\n<p>4.&nbsp;Types of Data Collected</p>\n<p>Personal Data</p>\n<p>While using our Service, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you (&ldquo;Personal Data&rdquo;). Personally identifiable information may include, but is not limited to:</p>\n<p>0.1. Email address</p>\n<p>0.2. First name and last name</p>\n<p>0.3. Phone number</p>\n<p>0.4. Address, Country, State, Province, ZIP/Postal code, City</p>\n<p>0.5. Cookies and Usage Data</p>\n<p>We may use your Personal Data to contact you with newsletters, marketing or promotional materials and other information that may be of interest to you. You may opt out of receiving any, or all, of these communications from us by following the unsubscribe link.</p>\n<p>Usage Data</p>\n<p>We may also collect information that your browser sends whenever you visit our Service or when you access Service by or through any device (&ldquo;Usage Data&rdquo;).</p>\n<p>This Usage Data may include information such as your computer&rsquo;s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that you visit, the time and date of your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\n<p>When you access Service with a device, this Usage Data may include information such as the type of device you use, your device unique ID, the IP address of your device, your device operating system, the type of Internet browser you use, unique device identifiers and other diagnostic data.</p>\n<div id="m_6073987355650946935m_839432200449661562m_-5940260934239069393location">\n<p>Location Data</p>\n<p>We may use and store information about your location if you give us permission to do so (&ldquo;Location Data&rdquo;). We use this data to provide features of our Service, to improve and customize our Service.</p>\n<p>You can enable or disable location services when you use our Service at any time by way of your device settings.</p>\n</div>\n<p>Tracking Cookies Data</p>\n<p>We use cookies and similar tracking technologies to track the activity on our Service and we hold certain information.</p>\n<p>Cookies are files with a small amount of data which may include an anonymous unique identifier. Cookies are sent to your browser from a website and stored on your device. Other tracking technologies are also used such as beacons, tags and scripts to collect and track information and to improve and analyze our Service.</p>\n<p>You can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. However, if you do not accept cookies, you may not be able to use some portions of our Service.</p>\n<p>Examples of Cookies we use:</p>\n<p>0.1.&nbsp;Session Cookies:&nbsp;We use Session Cookies to operate our Service.</p>\n<p>0.2.&nbsp;Preference Cookies:&nbsp;We use Preference Cookies to remember your preferences and various settings.</p>\n<p>0.3.&nbsp;Security Cookies:&nbsp;We use Security Cookies for security purposes.</p>\n<p>0.4.&nbsp;Advertising Cookies:&nbsp;Advertising Cookies are used to serve you with advertisements that may be relevant to you and your interests.</p>\n<p>Other Data</p>\n<p>While using our Service, we may also collect the following information: sex, age, date of birth, place of birth, passport details, citizenship, registration at place of residence and actual address, telephone number (work, mobile), details of documents on education, qualification, professional training, employment agreements,&nbsp;<a href="https://policymaker.io/non-disclosure-agreement/" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=https://policymaker.io/non-disclosure-agreement/&amp;source=gmail&amp;ust=1603006546799000&amp;usg=AFQjCNFS42_U-05hrnDgLh91MgK2yJMI7w">NDA agreements</a>, information on bonuses and compensation, information on marital status, family members, social security (or other taxpayer identification) number, office location and other data.</p>\n<p>5.&nbsp;Use of Data</p>\n<p>wintips ltd&nbsp;uses the collected data for various purposes:</p>\n<p>0.1. to provide and maintain our Service;</p>\n<p>0.2. to notify you about changes to our Service;</p>\n<p>0.3. to allow you to participate in interactive features of our Service when you choose to do so;</p>\n<p>0.4. to provide customer support;</p>\n<p>0.5. to gather analysis or valuable information so that we can improve our Service;</p>\n<p>0.6. to monitor the usage of our Service;</p>\n<p>0.7. to detect, prevent and address technical issues;</p>\n<p>0.8. to fulfil any other purpose for which you provide it;</p>\n<p>0.9. to carry out our obligations and enforce our rights arising from any contracts entered into between you and us, including for billing and collection;</p>\n<p>0.10. to provide you with notices about your account and/or subscription, including expiration and renewal notices, email-instructions, etc.;</p>\n<p>0.11. to provide you with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless you have opted not to receive such information;</p>\n<p>0.12. in any other way we may describe when you provide the information;</p>\n<p>0.13. for any other purpose with your consent.</p>\n<p>6.&nbsp;Retention of Data</p>\n<p>We will retain your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</p>\n<p>We will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period, except when this data is used to strengthen the security or to improve the functionality of our Service, or we are legally obligated to retain this data for longer time periods.</p>\n<p>7.&nbsp;Transfer of Data</p>\n<p>Your information, including Personal Data, may be transferred to &ndash; and maintained on &ndash; computers located outside of your state, province, country or other governmental jurisdiction where the data protection laws may differ from those of your jurisdiction.</p>\n<p>If you are located outside&nbsp;mauritius&nbsp;and choose to provide information to us, please note that we transfer the data, including Personal Data, to&nbsp;mauritius&nbsp;and process it there.</p>\n<p>Your consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.</p>\n<p>wintips ltd&nbsp;will take all the steps reasonably necessary to ensure that your data is treated securely and in accordance with this Privacy Policy and no transfer of your Personal Data will take place to an organisation or a country unless there are adequate controls in place including the security of your data and other personal information.</p>\n<p>8.&nbsp;Disclosure of Data</p>\n<p>We may disclose personal information that we collect, or you provide:</p>\n<div id="m_6073987355650946935m_839432200449661562m_-5940260934239069393disclosure">\n<p>0.1.&nbsp;Business Transaction.</p>\n<p>If we or our subsidiaries are involved in a merger, acquisition or asset sale, your Personal Data may be transferred.</p>\n<p>0.2.&nbsp;Other cases. We may disclose your information also:</p>\n<p>0.2.1. to our subsidiaries and affiliates;</p>\n<p>0.2.2. to contractors, service providers, and other third parties we use to support our business;</p>\n<p>0.2.3. to fulfill the purpose for which you provide it;</p>\n<p>0.2.4. for the purpose of including your company&rsquo;s logo on our website;</p>\n<p>0.2.5. for any other purpose disclosed by us when you provide the information;</p>\n<p>0.2.6. with your consent in any other cases;</p>\n<p>0.2.7. if we believe disclosure is necessary or appropriate to protect the rights, property, or safety of the Company, our customers, or others.</p>\n</div>\n<p>9.&nbsp;Security of Data</p>\n<p>The security of your data is important to us but remember that no method of transmission over the Internet or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Data, we cannot guarantee its absolute security.</p>\n<p>10.&nbsp;Your Data Protection Rights Under General Data Protection Regulation (GDPR)</p>\n<p>If you are a resident of the European Union (EU) and European Economic Area (EEA), you have certain data protection rights, covered by GDPR.</p>\n<p>We aim to take reasonable steps to allow you to correct, amend, delete, or limit the use of your Personal Data.</p>\n<p>If you wish to be informed what Personal Data we hold about you and if you want it to be removed from our systems, please email us at&nbsp;<a href="mailto:support@tip74.com" target="_blank" rel="noopener">support@tip74.com</a>.</p>\n<p>In certain circumstances, you have the following data protection rights:</p>\n<p>0.1. the right to access, update or to delete the information we have on you;</p>\n<p>0.2. the right of rectification. You have the right to have your information rectified if that information is inaccurate or incomplete;</p>\n<p>0.3. the right to object. You have the right to object to our processing of your Personal Data;</p>\n<p>0.4. the right of restriction. You have the right to request that we restrict the processing of your personal information;</p>\n<p>0.5. the right to data portability. You have the right to be provided with a copy of your Personal Data in a structured, machine-readable and commonly used format;</p>\n<p>0.6. the right to withdraw consent. You also have the right to withdraw your consent at any time where we rely on your consent to process your personal information;</p>\n<p>Please note that we may ask you to verify your identity before responding to such requests. Please note, we may not able to provide Service without some necessary data.</p>\n<p>You have the right to complain to a Data Protection Authority about our collection and use of your Personal Data. For more information, please contact your local data protection authority in the European Economic Area (EEA).</p>\n<p>11.&nbsp;Your Data Protection Rights under the California Privacy Protection Act (CalOPPA)</p>\n<p>CalOPPA is the first state law in the nation to require commercial websites and online services to post a privacy policy. The law&rsquo;s reach stretches well beyond California to require a person or company in the United States (and conceivable the world) that operates websites collecting personally identifiable information from California consumers to post a conspicuous privacy policy on its website stating exactly the information being collected and those individuals with whom it is being shared, and to comply with this policy.</p>\n<p>According to CalOPPA we agree to the following:</p>\n<p>0.1. users can visit our site anonymously;</p>\n<p>0.2. our Privacy Policy link includes the word &ldquo;Privacy&rdquo;, and can easily be found on the home page of our website;</p>\n<p>0.3. users will be notified of any privacy policy changes on our Privacy Policy Page;</p>\n<p>0.4. users are able to change their personal information by emailing us at&nbsp;<a href="mailto:support@tip74.com" target="_blank" rel="noopener">support@tip74.com</a>.</p>\n<p>Our Policy on &ldquo;Do Not Track&rdquo; Signals:</p>\n<p>We honor Do Not Track signals and do not track, plant cookies, or use advertising when a Do Not Track browser mechanism is in place. Do Not Track is a preference you can set in your web browser to inform websites that you do not want to be tracked.</p>\n<p>You can enable or disable Do Not Track by visiting the Preferences or Settings page of your web browser.</p>\n<p>12.&nbsp;Your Data Protection Rights under the California Consumer Privacy Act (CCPA)</p>\n<p>If you are a California resident, you are entitled to learn what data we collect about you, ask to delete your data and not to sell (share) it. To exercise your data protection rights, you can make certain requests and ask us:</p>\n<p>0.1. What personal information we have about you. If you make this request, we will return to you:</p>\n<p>0.0.1. The categories of personal information we have collected about you.</p>\n<p>0.0.2. The categories of sources from which we collect your personal information.</p>\n<p>0.0.3. The business or commercial purpose for collecting or selling your personal information.</p>\n<p>0.0.4. The categories of third parties with whom we share personal information.</p>\n<p>0.0.5. The specific pieces of personal information we have collected about you.</p>\n<p>0.0.6. A list of categories of personal information that we have sold, along with the category of any other company we sold it to. If we have not sold your personal information, we will inform you of that fact.</p>\n<p>0.0.7. A list of categories of personal information that we have disclosed for a business purpose, along with the category of any other company we shared it with.</p>\n<p>Please note, you are entitled to ask us to provide you with this information up to two times in a rolling twelve-month period. When you make this request, the information provided may be limited to the personal information we collected about you in the previous 12 months.</p>\n<p>0.2. To delete your personal information. If you make this request, we will delete the personal information we hold about you as of the date of your request from our records and direct any service providers to do the same. In some cases, deletion may be accomplished through de-identification of the information. If you choose to delete your personal information, you may not be able to use certain functions that require your personal information to operate.</p>\n<p>0.3. To stop selling your personal information. We don&rsquo;t sell or rent your personal information to any third parties for any purpose. We do not sell your personal information for monetary consideration. However, under some circumstances, a transfer of personal information to a third party, or within our family of companies, without monetary consideration may be considered a &ldquo;sale&rdquo; under California law. You are the only owner of your Personal Data and can request disclosure or deletion at any time.</p>\n<p>If you submit a request to stop selling your personal information, we will stop making such transfers.</p>\n<p>Please note, if you ask us to delete or stop selling your data, it may impact your experience with us, and you may not be able to participate in certain programs or membership services which require the usage of your personal information to function. But in no circumstances, we will discriminate against you for exercising your rights.</p>\n<p>To exercise your California data protection rights described above, please send your request(s) by email:&nbsp;<a href="mailto:support@tip74.com" target="_blank" rel="noopener">support@tip74.com</a>.</p>\n<p>Your data protection rights, described above, are covered by the CCPA, short for the California Consumer Privacy Act. To find out more, visit the official California Legislative Information website. The CCPA took effect on 01/01/2020.</p>\n<p>13.&nbsp;Service Providers</p>\n<p>We may employ third party companies and individuals to facilitate our Service (&ldquo;Service Providers&rdquo;), provide Service on our behalf, perform Service-related services or assist us in analysing how our Service is used.</p>\n<p>These third parties have access to your Personal Data only to perform these tasks on our behalf and are obligated not to disclose or use it for any other purpose.</p>\n<p>14.&nbsp;Analytics</p>\n<p>We may use third-party Service Providers to monitor and analyze the use of our Service.</p>\n<p>15.&nbsp;CI/CD tools</p>\n<p>We may use third-party Service Providers to automate the development process of our Service.</p>\n<div id="m_6073987355650946935m_839432200449661562m_-5940260934239069393advertising">\n<p>16.&nbsp;Advertising</p>\n<p>We may use third-party Service Providers to show advertisements to you to help support and maintain our Service.</p>\n</div>\n<p>17.&nbsp;Behavioral Remarketing</p>\n<p>We may use remarketing services to advertise on third party websites to you after you visited our Service. We and our third-party vendors use cookies to inform, optimise and serve ads based on your past visits to our Service.</p>\n<div id="m_6073987355650946935m_839432200449661562m_-5940260934239069393payments">\n<p>18.&nbsp;Payments</p>\n<p>We may provide paid products and/or services within Service. In that case, we use third-party services for payment processing (e.g. payment processors).</p>\n<p>We will not store or collect your payment card details. That information is provided directly to our third-party payment processors whose use of your personal information is governed by their Privacy Policy. These payment processors adhere to the standards set by PCI-DSS as managed by the PCI Security Standards Council, which is a joint effort of brands like Visa, Mastercard, American Express and Discover. PCI-DSS requirements help ensure the secure handling of payment information.</p>\n</div>\n<p>19.&nbsp;Links to Other Sites</p>\n<p>Our Service may contain links to other sites that are not operated by us. If you click a third party link, you will be directed to that third party&rsquo;s site. We strongly advise you to review the Privacy Policy of every site you visit.</p>\n<p>We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.</p>\n<p>For example, the outlined&nbsp;<a href="https://policymaker.io/privacy-policy/" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=https://policymaker.io/privacy-policy/&amp;source=gmail&amp;ust=1603006546799000&amp;usg=AFQjCNHLIB6LnWO5a1BiaGcAW90lCFfRpQ">privacy policy</a>&nbsp;has been made using&nbsp;<a href="https://policymaker.io/" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=https://policymaker.io/&amp;source=gmail&amp;ust=1603006546800000&amp;usg=AFQjCNFUtkFDhsGmxsVrkLJ74hM-xjDSMQ">PolicyMaker.io</a>, a free tool that helps create high-quality legal documents. PolicyMaker&rsquo;s&nbsp;<a href="https://policymaker.io/privacy-policy/" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=https://policymaker.io/privacy-policy/&amp;source=gmail&amp;ust=1603006546800000&amp;usg=AFQjCNF-3y25HLqwWYvx30YaAYdwxQiXXw">privacy policy generator</a>&nbsp;is an easy-to-use tool for creating a&nbsp;<a href="https://policymaker.io/blog-privacy-policy/" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=https://policymaker.io/blog-privacy-policy/&amp;source=gmail&amp;ust=1603006546800000&amp;usg=AFQjCNGQF0QAUPtotV7CVqloXLP2TzxhHQ">privacy policy for blog</a>, website, e-commerce store or mobile app.</p>\n<p>20.&nbsp;Children&rsquo;s Privacy</p>\n<p>Our Services are not intended for use by children under the age of 18 (&ldquo;Child&rdquo;&nbsp;or&nbsp;&ldquo;Children&rdquo;).</p>\n<p>We do not knowingly collect personally identifiable information from Children under 18. If you become aware that a Child has provided us with Personal Data, please contact us. If we become aware that we have collected Personal Data from Children without verification of parental consent, we take steps to remove that information from our servers.</p>\n<p>21.&nbsp;Changes to This Privacy Policy</p>\n<p>We may update our Privacy Policy from time to time. We will notify you of any changes by posting the new Privacy Policy on this page.</p>\n<p>We will let you know via email and/or a prominent notice on our Service, prior to the change becoming effective and update &ldquo;effective date&rdquo; at the top of this Privacy Policy.</p>\n<p>You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p>\n<p>22.&nbsp;Contact Us</p>\n<p>If you have any questions about this Privacy Policy, please contact us by email:&nbsp;<a href="mailto:support@tip74.com" target="_blank" rel="noopener">support@tip74.com</a>.</p>\n<p>This&nbsp;<a href="https://policymaker.io/privacy-policy/" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=https://policymaker.io/privacy-policy/&amp;source=gmail&amp;ust=1603006546800000&amp;usg=AFQjCNF-3y25HLqwWYvx30YaAYdwxQiXXw">Privacy Policy</a>&nbsp;was created for&nbsp;<a href="http://tip74.com" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=http://tip74.com&amp;source=gmail&amp;ust=1603006546800000&amp;usg=AFQjCNET3Nm0usqNuMzybBRXDvUimnec5w">tip74.com</a>&nbsp;by&nbsp;<a href="https://policymaker.io/" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=https://policymaker.io/&amp;source=gmail&amp;ust=1603006546800000&amp;usg=AFQjCNFUtkFDhsGmxsVrkLJ74hM-xjDSMQ">PolicyMaker.<wbr />io</a>&nbsp;on&nbsp;2020-09-16.</p>\n</div>\n<h2>&nbsp;</h2>'),
(5, 'disclaimer', 'Disclaimer', '<p>WEBSITE DISCLAIMER</p>\n<p>The information provided by&nbsp;wintips ltd&nbsp;(&ldquo;Company&rdquo;, &ldquo;we&rdquo;, &ldquo;our&rdquo;, &ldquo;us&rdquo;) on&nbsp;<a href="http://tip74.com" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=http://tip74.com&amp;source=gmail&amp;ust=1603006546800000&amp;usg=AFQjCNET3Nm0usqNuMzybBRXDvUimnec5w">tip74.com</a>&nbsp;(the &ldquo;Site&rdquo;) is for general informational purposes only. All information on the Site is provided in good faith, however we make no representation or warranty of any kind, express or implied, regarding the accuracy, adequacy, validity, reliability, availability, or completeness of any information on the Site.</p>\n<p>UNDER NO CIRCUMSTANCE SHALL WE HAVE ANY LIABILITY TO YOU FOR ANY LOSS OR DAMAGE OF ANY KIND INCURRED AS A RESULT OF THE USE OF THE SITE OR RELIANCE ON ANY INFORMATION PROVIDED ON THE SITE. YOUR USE OF THE SITE AND YOUR RELIANCE ON ANY INFORMATION ON THE SITE IS SOLELY AT YOUR OWN RISK.</p>\n<p>EXTERNAL LINKS DISCLAIMER</p>\n<p>The Site may contain (or you may be sent through the Site) links to other websites or content belonging to or originating from third parties or links to websites and features. Such external links are not investigated, monitored, or checked for accuracy, adequacy, validity, reliability, availability or completeness by us.</p>\n<p>For example, the outlined&nbsp;<a href="https://policymaker.io/disclaimer/" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=https://policymaker.io/disclaimer/&amp;source=gmail&amp;ust=1603006546800000&amp;usg=AFQjCNGLcKNxrmhYajNpznbexl-HhuvKfA">Disclaimer</a>&nbsp;has been created using&nbsp;<a href="https://policymaker.io/" target="_blank" rel="noopener" data-saferedirecturl="https://www.google.com/url?hl=en&amp;q=https://policymaker.io/&amp;source=gmail&amp;ust=1603006546800000&amp;usg=AFQjCNFUtkFDhsGmxsVrkLJ74hM-xjDS