(8, 'soccerrules', 'Soccer Rules', '<div>\n<div>&nbsp;</div>\n<div>\n<div>\n<div>\n<p class="p1"><strong>Soccer/Football &ndash; Tipping Rules</strong></p>\n</div>\n<div>● Soccer / Football involves English Premier League, Spanish La Liga, Germany Bundesliga, Italy Serie A and France Ligue 1.</div>\n<div>&nbsp;</div>\n<div>● Choose any 10 games per entry from any of the 5 leagues each week to predict (tip) in.</div>\n<div>&nbsp;</div>\n<div>● Members can submit as many entries as they wish each week.</div>\n<div>&nbsp;</div>\n<div>● Predictions (tips) can be entered or edited up and until the nominated commencement time.</div>\n<div>&nbsp;</div>\n<div>\n<div>● If no predictions (tips) are entered 0 points are awarded.</div>\n<div>&nbsp;</div>\n</div>\n<div>● Double Up - Choose any 5 games from your selected games each entry, by ticking the Double Up box to have your winning points doubled. When the 5 Double-Ups have been used on each entry user will be notified.</div>\n<div>&nbsp;</div>\n<div>● Cash prizes will be awarded every week.</div>\n<div>&nbsp;</div>\n<div>● Predictions (tips) can be entered or edited up and until the official nominated commencement time.</div>\n<div>&nbsp;</div>\n<div>\n<div>● If no predictions (tips) are entered 0 points are awarded.</div>\n<div>&nbsp;</div>\n</div>\n<div>● Predictions - Enter the full-time score and this automatically predicts the Correct Score at Full Time, the Full-Time Result, The Outsider if tipped and Both Teams To Score predictions also for you. Then enter the half-time score and this automatically predicts the Correct Score at Half Time and the Half Time Result also for you. If you Double Up just tick the box then hit lock.</div>\n</div>\n<div>&nbsp;</div>\n<div>● The member who has accumulated the most points for each week is the winner. Should two or more members have equal points the prize is split equally.</div>\n<div>&nbsp;</div>\n<div>● Should any game of soccer be postponed/rescheduled, the week is not complete until played.</div>\n<div>&nbsp;</div>\n<div>● Should a game be canceled it will be null and void and no points awarded to any member.</div>\n</div>\n</div>\n<div>\n<div>&nbsp;</div>\n</div>'),
(9, 'racingrules', 'Horse Racing Rules', '<div>\n<div>&nbsp;</div>\n</div>\n<div><strong>Mauritius Horse Racing &ndash; Tipping Rules</strong></div>\n<div>&nbsp;</div>\n<div>● The Mauritian Horse racing is contested over the given racing season.</div>\n<div>&nbsp;</div>\n<div>● Cash prizes will be awarded every meeting.</div>\n<div>&nbsp;</div>\n<div>\n<div>● Members can submit as many entries as they wish each week.</div>\n<div>&nbsp;</div>\n</div>\n<div>● Race predictions - in each race predict 1st, 2nd and 3rd placings. (points are shown in horse racing points section)</div>\n<div>&nbsp;</div>\n<div>● If your selection for 1st wins and the starting odds is 10/1 (1000rs) or above, points are doubled for this selection only, so if you have Doubled Up already on this race your selection for first will be worth 40 points.</div>\n<div>&nbsp;</div>\n<div>● Each horse is only allowed to be used once if edit more then 1entry.</div>\n<div>&nbsp;</div>\n<div>● Double Up - All points for 4 particular races you select per entry for the meeting are doubled, When the 4 Double Ups have been used on each entry you will be notified.&nbsp; (Not eligible for leading trainer or jockey points).</div>\n<div>&nbsp;</div>\n<div>\n<div>● Predictions (tips) can be entered or edited up and until the nominated race commencement time.</div>\n<div>&nbsp;</div>\n<div>\n<div>● Under no circumstances will a prediction (tip) be accepted after the races nominated commencement time.</div>\n<div>&nbsp;</div>\n</div>\n</div>\n<div>● Leading Trainer and Jockey - at end of meeting the Leading Trainer and Jockey are who has accumulated the most points from having 1st, 2nd or 3rd placings. (points are shown in horse racing points section)</div>\n<div>&nbsp;</div>\n<div>● Leading Trainer and Jockey must be predicted before race 1 nominated commencement time.</div>\n<div>&nbsp;</div>\n<div>● If no predictions (tips) are entered 0 points are awarded.</div>\n<div>&nbsp;</div>\n<div>\n<div>● The member who has accumulated the most points for the meeting is the winner. Should two or more members have equal points the prize is split equally.</div>\n<div>&nbsp;</div>\n</div>\n<div>\n<div>● Should a race be canceled it will be null and void and no points awarded to any member for this given race.</div>\n<div>&nbsp;</div>\n</div>'),
(10, 'soccerpoints', 'Soccer Points', '<div>\n<div>Points are automatically awarded by the system according to the table below.</div>\n</div>\n<div>&nbsp;</div>\n<div>\n<table border="1"><caption>&nbsp;</caption>\n<tbody>\n<tr>\n<td valign="top">\n<div><strong>Prediction</strong></div>\n</td>\n<td valign="top">\n<div><strong>Points</strong></div>\n</td>\n<td valign="top">\n<div><strong>Description</strong></div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Correct score at Full Time</div>\n</td>\n<td valign="top">\n<div>10</div>\n</td>\n<td valign="top">\n<div>An exact score prediction at full-time awards the player with 10 points, otherwise 0</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Full Time Result</div>\n</td>\n<td valign="top">\n<div>2</div>\n</td>\n<td valign="top">\n<div>Correct Full Time prediction, options are winning team or draw, the prediction is automatically generated according to the scores entered for the Correct Score at full Time, the correct prediction is awarded with 2 point, otherwise 0.&nbsp;</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Outsider Wins At Full Time&nbsp; &nbsp;</div>\n</td>\n<td valign="top">\n<div>2</div>\n</td>\n<td valign="top">\n<div>If winning prediction at full time is the outsider ( longest odds ) of the 2 teams, the prediction is automatically generated according to the scores entered for the Correct Score at full Time, the correct prediction is awarded with 2 point, otherwise 0.&nbsp;</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Correct Score At Half Time</div>\n</td>\n<td valign="top">\n<div>5</div>\n</td>\n<td valign="top">\n<div>An exact score prediction at half time awards the player with 5 points, otherwise 0</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Half Time Result</div>\n</td>\n<td valign="top">\n<div>1</div>\n</td>\n<td valign="top">\n<div>Correct Half Time prediction, options are winning team or draw, the prediction is automatically generated according to the scores entered for the Correct Score at half Time, the correct prediction is awarded with 1 point, otherwise 0.&nbsp;</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Both Teams To Score</div>\n</td>\n<td valign="top">\n<div>1</div>\n</td>\n<td valign="top">\n<div>If both teams score, the prediction is automatically generated according to the scores entered for the Correct Score at full Time, the correct prediction is awarded with 1 point, otherwise 0.&nbsp;</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Double Up</div>\n</td>\n<td valign="top">\n<div>&nbsp;</div>\n</td>\n<td valign="top">\n<div>All points for that particular match are doubled. 5 double ups are allowed each entry consisting of 10 games.&nbsp;</div>\n</td>\n</tr>\n</tbody>\n</table>\n</div>');
INSERT INTO `set_pages` (`PageID`, `PageGUID`, `Title`, `Content`) VALUES
(11, 'racingpoints', 'Horse Racing Points', '<div>\n<p><strong>Points - Leading Trainer and Jockey.</strong></p>\n</div>\n<div>\n<table border="1"><caption>&nbsp;</caption>\n<tbody>\n<tr>\n<td valign="top">\n<div><strong>Prediction</strong></div>\n</td>\n<td valign="top">\n<div><strong>Points</strong></div>\n</td>\n<td valign="top">\n<div><strong>Description</strong></div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Leading Trainer</div>\n</td>\n<td valign="top">\n<div>10</div>\n</td>\n<td valign="top">\n<div>10 Point - Correct Prediction</div>\n<div>0 Points - Otherwise</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Leading Jockey</div>\n</td>\n<td valign="top">\n<div>10</div>\n</td>\n<td valign="top">\n<div>10 Point - Correct Prediction</div>\n<div>0 Points - Otherwise</div>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<div>&nbsp;</div>\n<div>\n<p><strong>Points Per Race</strong></p>\n<table border="1"><caption>&nbsp;</caption>\n<tbody>\n<tr>\n<td valign="top">\n<div><strong>Prediction</strong></div>\n</td>\n<td valign="top">\n<div><strong>Points</strong></div>\n</td>\n<td valign="top">\n<div><strong>Description</strong></div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>1<sup>st</sup> Place</div>\n</td>\n<td valign="top">\n<div>10</div>\n</td>\n<td valign="top">\n<div>10 Points - Correct prediction &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0 Points - Otherwise&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Winners odds 1000rs or better winning points doubled</div>\n</td>\n<td valign="top">\n<div>&nbsp;</div>\n</td>\n<td valign="top">\n<div>If the winning predictions odds are 10/1 or better, points for 1st place prediction are doubled. If already double up on this race points for 1st place will be worth 40 points.</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>2<sup>nd</sup> Place</div>\n</td>\n<td valign="top">\n<div>4</div>\n</td>\n<td valign="top">\n<div>4 Points - Correct prediction&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0 Points - Otherwise</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>3<sup>rd</sup> Place</div>\n</td>\n<td valign="top">\n<div>2</div>\n</td>\n<td valign="top">\n<div>2 Points - Correct prediction &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0 Points - Otherwise</div>\n</td>\n</tr>\n<tr>\n<td valign="top">\n<div>Double Up</div>\n</td>\n<td valign="top">\n<div>&nbsp;</div>\n</td>\n<td valign="top">\n<div>All points for that particular race are doubled. 4 double ups are allowed for each entry / meeting.</div>\n</td>\n</tr>\n</tbody>\n</table>\n</div>');
